function relativePrimes($values)
{
    $list = [];
    $length = count($values);
    $status = 0;
    $reject = array();

    for ($i = 1; $i < $length; $i++) {
        $status = gcd($values[$i-1], $values[$i]);
        if ($status != 1) {
            $values[$i-1]=-1;
        }
    }

    for ($i = 0; $i < $length; $i++) {
        for ($j = 0; $j < $length; $j++) {
            if (($i != $j)&&($values[$i]!=-1 && $values[$j]!=-1)) {
                $status = gcd($values[$i], $values[$j]);
                if ($status != 1) {
                    break;
                }
            }
        }
        if ($status == 1 && $values[$i]!=-1) {
            $list[] = $values[$i];
        }
    }
    print_r($list);
}

function gcd($a, $b)
{
    // Everything divides 0 a=4 b=3
    while ($b != 0) {
        $GCD = $b;
        $b = $a % $b;
        $a = $GCD;
    }
